const initialState = {
    userActiveDetails: "",
    selectedDateDetails: ""
}

export default function reducer(state = initialState, action) {
    switch (action.type) {
        case 'UserActiveDetails': return { ...state, userActiveDetails: action.target }
        case 'SelectedDateDetails': return { ...state, selectedDateDetails: action.target }
        default:
            return state;

    }
}
